    return {
      email: "",
      password: "",
      error: false,
    };
  },
  methods: {
    login() {
      const URL_USER = "https://628c24e1a3fd714fd02d5a68.mockapi.io/Usuarios";

      const json = {
        email: this.email,
      };
      axios
        .get(URL_USER, { params: json })
        .then((response) => {
          if (response.data[0] != undefined) {
            if (response.data[0].password == this.password) {
              this.addUser(response.data[0]);
              if (response.data[0].admin) {
                this.$router.push("/home").catch(() => {});
              } else {
                this.$router.push("/user").catch(() => {});
              }
            } else {
              this.error = true;
            }
          } else {
            this.error = true;
          }
        })
        .catch(function (error) {
          /* eslint-disable */;(oo_oo(),console.log(error, `91350b61_0`));
        });
